import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class MyBooks extends Component {

  getBooks(){
    const Http = new XMLHttpRequest();
    const url = 'http://localhost:8080/books';
    let books;
    Http.open("GET", url);
    Http.send();
    Http.onload = function(){
      books = JSON.parse(Http.responseText);
      return(
        <tr>
          <td>{books[0].title}</td>
          <td>{books[0].authors}</td>
          <td>{books[0].category}</td>
          <td>{books[0].numberOfPages}</td>
          <td>{books[0].readPages}/{books[0].numberOfPages}</td>
          <td>{books[0].yearOfPublishing}</td>
        </tr>
      );
    }

  }

  render() {




    return(
    <div>
      <table>
        <thead>
          <tr>
            <th>Title</th>
            <th>Authors</th>
            <th>Category</th>
            <th>Pages</th>
            <th>Read</th>
            <th>Year</th>
          </tr>
        </thead>
        <tbody>
          {this.getBooks()}
        </tbody>
      </table>
    </div>
    );
  }
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
        <div><MyBooks /></div>
      </div>
    );
  }
}

export default App;
